#
# TABLE STRUCTURE FOR: ESPACIO
#

DROP TABLE IF EXISTS `ESPACIO`;

CREATE TABLE `ESPACIO` (
  `ID_ESPACIO` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `NOMBRE` varchar(40) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `SUPERFICIE` float(6,3) unsigned NOT NULL,
  `ID_HOTEL` varchar(6) COLLATE utf8mb4_unicode_ci NOT NULL,
  `ID_ESPACIO_CONT` varchar(9) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `TIENE_INTERNET` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `TIENE_VISTAS` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'No',
  `ESTA_CLIMATIZADO` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`ID_ESPACIO`),
  KEY `ID_HOTEL` (`ID_HOTEL`),
  KEY `ID_ESPACIO_CONT` (`ID_ESPACIO_CONT`),
  CONSTRAINT `ESPACIO_ibfk_1` FOREIGN KEY (`ID_HOTEL`) REFERENCES `HOTEL` (`ID_HOTEL`) ON DELETE CASCADE,
  CONSTRAINT `ESPACIO_ibfk_2` FOREIGN KEY (`ID_ESPACIO_CONT`) REFERENCES `ESPACIO` (`ID_ESPACIO`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



